import React from "react";

import ContentBox from "./ContentBox";

const NoPhotoCard = ({id, title, author, created, description}) => {
    return (
        <div className="NoPhoto">
            <ContentBox
                id = {id}
                title = {title}
                author = {author}
                created = {created}
                description = {description}
            />
        </div>
    )
}

export default NoPhotoCard;
